import React from "react";
import { Col, Row, Container } from 'react-bootstrap';

function Main() {
    return (
        <Container className="main">
            <Row className="firstRow">
                <Col xl={6} lg={6} md={12}>
                    <p style={{fontSize:'1.8em',    fontWeight: '400'}}>Выберите товары<br/></p>
                      <h1>для вашего питомца</h1>                    
                </Col>
                <Col xl={6} lg={6} md={12}>
                    <input/>
                </Col>
            </Row>
        </Container>
    )
}

export default Main;
